# Replace placeholder table for vw_usuario_sistema with correct view syntax
# ------------------------------------------------------------

DROP TABLE `vw_usuario_sistema`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vw_usuario_sistema`
AS SELECT
   `USUARIO`.`COD_USUARIO` AS `COD_USUARIO`,
   `USUARIO`.`NOM_USUARIO` AS `NOM_USUARIO`,
   `USUARIO`.`NOM_LOGIN` AS `NOM_LOGIN`,
   `USUARIO`.`DES_EMAIL` AS `DES_EMAIL`,
   `USUARIO`.`NUM_CPF` AS `NUM_CPF`,
   `USUARIO`.`NUM_TELEFONE` AS `NUM_TELEFONE`,
   `USUARIO`.`NUM_CELULAR` AS `NUM_CELULAR`,
   `USUARIO_PERFIL`.`IND_ATIVO` AS `IND_ATIVO`,
   `USUARIO`.`IND_EXCLUIDO` AS `IND_EXCLUIDO`,
   `USUARIO`.`DAT_CADASTRO` AS `DAT_CADASTRO`,
   `USUARIO`.`COD_RESPONSAVEL_CADASTRO` AS `COD_RESPONSAVEL_CADASTRO`,
   `USUARIO`.`DAT_ATUALIZACAO` AS `DAT_ATUALIZACAO`,
   `USUARIO`.`COD_RESPONSAVEL_ATUALIZACAO` AS `COD_RESPONSAVEL_ATUALIZACAO`,
   `PERFIL`.`COD_PERFIL` AS `COD_PERFIL`,
   `PERFIL`.`NOM_PERFIL` AS `NOM_PERFIL`,
   `PERFIL`.`DES_CHAVE_PERFIL` AS `DES_CHAVE_PERFIL`,
   `SISTEMA`.`COD_SISTEMA` AS `COD_SISTEMA`,
   `SISTEMA`.`NOM_SISTEMA` AS `NOM_SISTEMA`
FROM (((`tb_usuario` `USUARIO` left join `rl_usuario_perfil` `USUARIO_PERFIL` on(((`USUARIO_PERFIL`.`COD_USUARIO` = `USUARIO`.`COD_USUARIO`) and (`USUARIO_PERFIL`.`IND_EXCLUIDO` = 0)))) left join `tb_perfil` `PERFIL` on((`PERFIL`.`COD_PERFIL` = `USUARIO_PERFIL`.`COD_PERFIL`))) left join `tb_sistema` `SISTEMA` on((`SISTEMA`.`COD_SISTEMA` = `PERFIL`.`COD_SISTEMA`))) where (`USUARIO`.`IND_EXCLUIDO` = 0);


